AvcMBEncPacket::AvcMBEncPacket(MediaResource* pSrc, MediaResource* pOutPakObj)
{
    resBind_.srcYuv.res = pSrc;
    resBind_.pakObj.res = pOutPakObj;

    picWidth_ = pSrc->getWidth();
    picHeight_ = pSrc->getHeight();
    picWInMB_ = UTIL_ALIGN(picWidth_, mbSize_) / mbSize_;
    picHInMB_ = UTIL_ALIGN(picHeight_, mbSize_) / mbSize_;

    picDs4xWidth_ = picWidth_ / 4;
    picDs4xHeight_ = picHeight_ / 4;
    picDs4xWInMB_ = UTIL_ALIGN(picDs4xWidth_, mbSize_) / mbSize_;
    picDs4xHInMB_ = UTIL_ALIGN(picDs4xHeight_, mbSize_) / mbSize_;

    kernelBlockWidth_ = 8;
    kernelBlockHeight_ = 8;
}

AvcMBEncPacket::~AvcMBEncPacket()
{
}

int32_t AvcMBEncPacket::createPacket()
{
    if (statusReport_ == nullptr)
    {
        statusReport_ = new MediaResource(RES_TYPE_BUFFER, RES_FORMAT_Buffer, 4096, false, "StatusReport");
        if (statusReport_->create() != 0)
            return -1;
    }

    if (timeStamp_ == nullptr)
    {
        timeStamp_ = new MediaResource(RES_TYPE_BUFFER, RES_FORMAT_Buffer, 4096, false, "TimeStamp");
        if (timeStamp_->create() != 0)
            return -1;
    }

    if (cmdBufIdGlobal_ == nullptr)
    {
        cmdBufIdGlobal_ = new MediaResource(RES_TYPE_BUFFER, RES_FORMAT_Buffer, 4096, false, "CommandBufferId");
        if (cmdBufIdGlobal_->create() != 0)
            return -1;
    }

    // allocate MBEnc specific resources
    if (allocateResource() != 0)
        return -1;

    //  Create GPU context (Render Ring) for this command packet
    if (createGpuContext(GPUNODE_3D) != 0)
    {
        return -1;
    }

    return 0;
}

int32_t AvcMBEncPacket::preparePacket()
{
    GpuCmdBase* pCmd = nullptr;
    uint32_t threadWidth = picWInMB_;
    uint32_t threadHeight = picHInMB_;

    // Initialize SSH, DSH (ID & Curbe) and ISH
    if (initStateHeap() != 0)
        return -1;

    // Construct a GPU command sequence for running a kernel
    if (constructCmdSequence(threadWidth, threadHeight) != 0)
        return -1;

    // Validate each GPU commands programming correctness
    if (validateCmdSequence() != 0)
        return -1;

    // Dump parsed command buffer into file
    if (dumpCmdSequence() != 0)
        return -1;

    // Collect all resources that are being referred by command packet
    // We need this resource list to residency management and synchronization
    updateResArray();

    // add external resources
    for (auto resBind : sshResBindList_)
    {
        if (resBind.res != nullptr)
        {
            addResource(resBind.res);
        }
    }

    return 0;
}

int32_t AvcMBEncPacket::submitPacket()
{
    if (buildCmdBuffer() != 0)
    {
        return -1;
    }

    if (submitCmdBuffer() != 0)
    {
        return -1;
    }

    return 0;
}

int32_t AvcMBEncPacket::destroyPacket()
{
    bool bFail = false;

    deleteGpuCmd();

    if (statusReport_)
    {
        if (statusReport_->destroy() != 0)
            bFail = true;
        delete statusReport_;
        statusReport_ = nullptr;
    }

    if (timeStamp_)
    {
        if (timeStamp_->destroy() != 0)
            bFail = true;
        delete timeStamp_;
        timeStamp_ = nullptr;
    }

    if (cmdBufIdGlobal_)
    {
        if (cmdBufIdGlobal_->destroy() != 0)
            bFail = true;
        delete cmdBufIdGlobal_;
        cmdBufIdGlobal_ = nullptr;
    }

    if (destroyResource() != 0)
        bFail = true;

    if (destroyStateHeap() != 0)
        bFail = true;

    //  Destroy GPU context
    if (destroyGpuContext() != 0)
        bFail = true;

    return (bFail) ? -1 : 0;
}

int32_t AvcMBEncPacket::constructCmdSequence(uint32_t threadWidth, uint32_t threadHeight)
{
    // Construct GPU command sequence
    addGpuCmd(new CmdPipeControl(FLUSH_WRITE_CACHE));
    //addGpuCmd(new CmdPipeControl(FLUSH_READ_CACHE, PSO_WRITE_IMMEDIATE_DATA, statusReport_, 0, 0));
    //addGpuCmd(new CmdPipeControl(FLUSH_WRITE_CACHE, PSO_WRITE_TIMESTAMP_REG, timeStamp_, 0, 0));
    //addGpuCmd(new CmdPipeControl(FLUSH_WRITE_CACHE, PSO_WRITE_IMMEDIATE_DATA, timeStamp_, 16, 1));

    // Enable L3 cache
    // APGTODO: encapsulate specific functions with operation code
    uint32_t offsetL3CacheConfigReg = 0x7034;
    uint32_t cacheConfigSetting = 0x60000121;
    addGpuCmd(new CmdMiLoadRegisterImm(offsetL3CacheConfigReg, cacheConfigSetting));

    // Adds preemption granularity control for Gen9.
    // Support preemption granularity control for 3D/GPGPU with non-privileged access
    // APGTODO: encapsulate specific functions with operation code
    uint32_t offsetPreemptionCtrlReg = 0x2580;
    uint32_t preemptionCtrlData = 0x00060004;
    addGpuCmd(new CmdMiLoadRegisterImm(offsetPreemptionCtrlReg, preemptionCtrlData));

#if 1
    addGpuCmd(new CmdPipelineSelect(PIPELINE_SELECTION_MEDIA));

    CmdStateBaseAddress* pCmdBaseAddr = new CmdStateBaseAddress;
    pCmdBaseAddr->addSSH(getCmdBuffer()->getCmdResource(), getCmdBuffer()->getSshOffset());
    pCmdBaseAddr->addDSH(getDSH()->getResource());
    pCmdBaseAddr->addISH(getISH()->getResource());
    addGpuCmd(pCmdBaseAddr);

    addGpuCmd(new CmdMediaVfeState(getDSH()->getCurbeSize()));
    addGpuCmd(new CmdMediaCurbeLoad(getDSH()->getCurbeSize(), getDSH()->getCurbeOffset()));
    addGpuCmd(new CmdMediaInterfaceDescriptorLoad(getDSH()->getIdSize(), getDSH()->getIdOffset()));

    // APGTODO: only set some key parameters, other parameters use default value
    addGpuCmd(new CmdMediaObjectWalker(threadWidth, threadHeight));

    //addGpuCmd(new CmdPipeControl(FLUSH_WRITE_CACHE, PSO_NOWRITE, timeStamp_, 0, 0));
    //addGpuCmd(new CmdPipeControl(FLUSH_READ_CACHE, PSO_WRITE_TIMESTAMP_REG, timeStamp_, 0, 0));
    //addGpuCmd(new CmdPipeControl(FLUSH_WRITE_CACHE, PSO_NOWRITE, cmdBufIdGlobal_, 0, 0));
    //addGpuCmd(new CmdPipeControl(FLUSH_READ_CACHE, PSO_WRITE_IMMEDIATE_DATA, cmdBufIdGlobal_, 0, 1));
    addGpuCmd(new CmdPipeControl(FLUSH_WRITE_CACHE));

    // Send Dummy VFE after PipelineSelect
    addGpuCmd(new CmdMediaVfeState(0));
    addGpuCmd(new CmdMediaStateFlush(true, 0));
#endif
    //addGpuCmd(new CmdPipeControl(FLUSH_WRITE_CACHE));
    addGpuCmd(new CmdMiBatchBufferEnd);

    return 0;
}

int32_t AvcMBEncPacket::setCurbe()
{
    // APGTODO: need pass these parameters from outside
    CODEC_AVC_ENCODE_PIC_PARAMS picParams = {};
    picParams.transform_8x8_mode_flag = 1;

    PCODEC_AVC_ENCODE_SEQUENCE_PARAMS pSeqParams = {};
    PCODEC_AVC_ENCODE_PIC_PARAMS pPicParams = &picParams;
    PCODEC_AVC_ENCODE_SLICE_PARAMS pSlcParams = {};

    uint8_t targetUsage = 7; // 1 ~ 7
    uint8_t picType = 0; // 0 - I; 1 - P; 2 - B;
    uint8_t sliceQP = 22; // 0 ~ 51

    // const CURBE for I frame
    memcpy(&curbe_, &constCurbe_.normalframeI[0], sizeof(curbe_));

    // R0: DW0 - DW7
    curbe_.DW0.AdaptiveEn = tables_["EnableAdaptiveSearch"][targetUsage];
    curbe_.DW0.T8x8FlagForInterEn = pPicParams->transform_8x8_mode_flag;
    curbe_.DW1.ExtendedMvCostRange = 0;
    curbe_.DW2.LenSP = tables_["MaxLenSP"][targetUsage];
    curbe_.DW2.PicWidth = picWInMB_;
    curbe_.DW3.SrcAccess = 0;
    curbe_.DW3.RefAccess = 0;
    curbe_.DW3.FTEnable = 0;

    curbe_.DW4.PicHeightMinus1 = picHInMB_ - 1;
    curbe_.DW4.FieldParityFlag = 0; // bBottomField ? 1 : 0;
    curbe_.DW4.EnableFBRBypass = true; // bFBRBypassEnable;
    curbe_.DW4.EnableIntraCostScalingForStaticFrame = 0; // pParams->bStaticFrameDetectionEnabled;
    curbe_.DW4.bCurFldIDR = 0; // bFramePicture ? 0 : (pPicParams->bIdrPic || m_firstFieldIdrPic);
    curbe_.DW4.ConstrainedIntraPredFlag = pPicParams->constrained_intra_pred_flag;
    curbe_.DW4.HMEEnable = 0; // m_hmeEnabled;
    curbe_.DW4.PictureType = 0; // m_encoder->wPictureCodingType - 1;
    curbe_.DW4.UseActualRefQPValue = 0; // m_hmeEnabled ? (MRDisableQPCheck[pSeqParams->TargetUsage] == 0) : false;
    curbe_.DW5.SliceMbHeight = picHInMB_; // pParams->usSliceHeight;
    curbe_.DW7.IntraPartMask = pPicParams->transform_8x8_mode_flag ? 0 : 0x2;  // Disable 8x8 if flag is not set
    curbe_.DW7.SrcFieldPolarity = 0; // bBottomField ? 1 : 0;

    // R1: DW8 - DW15
    if (sliceQP < 0 || sliceQP > 51)
        return -1;
    memcpy(&(curbe_.ModeMvCost), modeMvCost_[picType][sliceQP], 8 * sizeof(uint32_t));
    curbe_.ModeMvCost.DW13.QpPrimeY = sliceQP;
    // QpPrimeCb and QpPrimeCr are not used by Kernel. Following settings are for CModel matching.
    curbe_.ModeMvCost.DW13.QpPrimeCb = sliceQP;
    curbe_.ModeMvCost.DW13.QpPrimeCr = sliceQP;
    curbe_.ModeMvCost.DW13.TargetSizeInWord = 0xff; // hard coded for BRC disabled

    // R2: DW16 - DW23
    // R3: DW24 - DW31
    uint8_t u8TableIdx = (picType == 2) ? 1 : 0; // B frame or I/P frame
    uint8_t meMethod = (picType == 2) ? tables_["BMEMethod"][targetUsage] : tables_["MEMethod"][targetUsage];
    memcpy(&(curbe_.SPDelta), searchPath_[u8TableIdx][meMethod], 16 * sizeof(uint32_t));

    // R4: DW32 - DW39
    curbe_.DW32.MultiPredL0Disable = 0x80; //  CODECHAL_ENCODE_AVC_MULTIPRED_DISABLE;
    curbe_.DW32.MultiPredL1Disable = 0x80; //  CODECHAL_ENCODE_AVC_MULTIPRED_DISABLE;
    curbe_.DW34.EnablePerMBStaticCheck = 0; // pParams->bStaticFrameDetectionEnabled;
    curbe_.DW34.EnableAdaptiveSearchWindowSize = 1; // pParams->bApdatvieSearchWindowSizeEnabled;
    curbe_.DW34.bOriginalBff = 0;
    curbe_.DW34.EnableMBFlatnessChkOptimization = 0; // m_encoder->bFlatnessCheckEnabled;
    curbe_.DW34.ROIEnableFlag = 0; // pParams->bRoiEnabled;
    curbe_.DW34.MADEnableFlag = 0; // m_encoder->bMADEnabled;
    curbe_.DW34.MBBrcEnable = 0; // bMbBrcEnabled || bMbQpDataEnabled;
    curbe_.DW34.ArbitraryNumMbsPerSlice = 0; // m_encoder->bArbitraryNumMbsInSlice;
    curbe_.DW34.ForceNonSkipMbEnable = 0; // pParams->bMbDisableSkipMapEnabled;
    curbe_.DW34.DisableEncSkipCheck = 0; //  pParams->pAvcQCParams->skipCheckDisable;
    curbe_.DW34.TQEnable = 0; // m_trellisQuantParams.dwTqEnabled; //Enabled for KBL
    curbe_.DW34.CQPFlag = 1; // 1 - Rate Control is CQP, 0 - Rate Control is BRC
    curbe_.DW34.IntraRefreshEn = 0;
    curbe_.DW36.CheckAllFractionalEnable = 0; //  bCAFEnable;
    curbe_.DW36.HMECombineOverlap = 0;
    curbe_.DW37.AdaptiveEn = tables_["EnableAdaptiveSearch"][targetUsage];
    curbe_.DW37.T8x8FlagForInterEn = pPicParams->transform_8x8_mode_flag;
    curbe_.DW38.LenSP = 0;
    curbe_.DW38.RefThreshold = 400; // m_refThreshold;
    curbe_.DW39.HMERefWindowsCombThreshold = (picType == 2) ? tables_["HMEBCombineLen"][targetUsage] : tables_["HMECombineLen"][targetUsage];

    // R5: DW40 - DW47
    curbe_.DW46.RefCost = refCostMultiRefQp_[picType][sliceQP];

    // Default:2 used for MBBRC (MB QP Surface width and height are 4x downscaled picture in MB unit * 4  bytes)
    // 0 used for MBQP data surface (MB QP Surface width and height are same as the input picture size in MB unit * 1bytes)
    // BRC use split kernel, MB QP surface is same size as input picture
    curbe_.DW47.MbQpReadFactor = 2;// (bMbBrcEnabled || bMbQpDataEnabled) ? 0 : 2;
    curbe_.DW47.IntraCostSF = 16; // This is not used but recommended to set this to 16 by Kernel team

    // R6: DW48 - DW55

    // R7: DW56 - DW63
    //IPCM QP and threshold
    curbe_.DW62.IPCM_QP0 = 2;
    curbe_.DW62.IPCM_QP1 = 4;
    curbe_.DW62.IPCM_QP2 = 6;
    curbe_.DW62.IPCM_QP3 = 10;
    curbe_.DW63.IPCM_QP4 = 18;
    curbe_.DW63.IPCM_Thresh0 = 3000;

    // R8: DW64 - DW71
    curbe_.DW64.IPCM_Thresh1 = 3600;
    curbe_.DW64.IPCM_Thresh2 = 5000;
    curbe_.DW65.IPCM_Thresh3 = 7500;
    curbe_.DW65.IPCM_Thresh4 = 9000;
    curbe_.DW66.MBDataSurfIndex = resBind_.pakObj.surfIndex;
    curbe_.DW67.MVDataSurfIndex = resBind_.mvData.surfIndex;
    curbe_.DW68.IDistSurfIndex = resBind_.brcDistI.surfIndex;
    curbe_.DW69.SrcYSurfIndex = resBind_.srcYuv.surfIndex;
    curbe_.DW70.MBSpecificDataSurfIndex = resBind_.mbSpecificData.surfIndex;
    curbe_.DW71.AuxVmeOutSurfIndex = resBind_.auxVmeOut.surfIndex;

    // R9: DW72 - DW79
    curbe_.DW72.CurrRefPicSelSurfIndex = resBind_.curRefPicSelect.surfIndex;
    curbe_.DW73.HMEMVPredFwdBwdSurfIndex = resBind_.mvPredictorFromHME.surfIndex;
    curbe_.DW74.HMEDistSurfIndex = resBind_.distFromHME.surfIndex;
    curbe_.DW75.SliceMapSurfIndex = resBind_.sliceMap.surfIndex;
    curbe_.DW76.FwdFrmMBDataSurfIndex = resBind_.forwardMbDataForBframe.surfIndex;
    curbe_.DW77.FwdFrmMVSurfIndex = resBind_.forwardMVForBframe.surfIndex;
    curbe_.DW78.MBQPBuffer = resBind_.mbQP.surfIndex;
    curbe_.DW79.MBBRCLut = resBind_.mbBrcConst.surfIndex;

    // R10: DW80 - DW87
    curbe_.DW80.VMEInterPredictionSurfIndex = resBind_.vmeInterPredCurPic.surfIndex;
    curbe_.DW81.VMEInterPredictionMRSurfIndex = resBind_.vmeInterPredFwdMR.surfIndex;
    curbe_.DW82.MBStatsSurfIndex = resBind_.mbStats.surfIndex;
    curbe_.DW83.MADSurfIndex = resBind_.dataMAD.surfIndex;
    curbe_.DW84.BRCCurbeSurfIndex = resBind_.brcBufForMbEnc.surfIndex;
    curbe_.DW85.ForceNonSkipMBmapSurface = resBind_.forceNonSkipMbMap.surfIndex;
    curbe_.DW86.ReservedIndex = resBind_.advWA.surfIndex;
    curbe_.DW87.StaticDetectionCostTableIndex = resBind_.staticDetectionCostTable.surfIndex;

    return 0;
}

int32_t AvcMBEncPacket::initStateHeap()
{
    // Initialize Surface State heap
    if (initSSH(sshResBindList_) != 0)
        return -1;

    // Initialize Instruction State heap
    // Note: currently we pass the gen specific ISA binary instead of CISA binary
    std::vector<uint32_t>& kernelBinary = (isField_) ? kernelMbEncPerfIGen9ISA_ : kernelMbEncPerfIGen9ISA_;
    uint8_t* pKernelData = reinterpret_cast<uint8_t*>(kernelBinary.data());
    std::vector<uint8_t> scalingKernelBin(pKernelData, pKernelData + kernelBinary.size() * 4);

    if (initISH(scalingKernelBin) != 0)
        return -1;

    // Set Curbe data for MBEnc kernel
    if (setCurbe() != 0)
        return -1;

    // Initialize Dynamical State heap
    if (initDSH((uint8_t*)&curbe_, sizeof(curbe_)) != 0)
        return -1;

    return 0;
}

int32_t AvcMBEncPacket::allocateResource()
{
    uint32_t allocSize = 0;
    uint32_t allocWidth = 0;
    uint32_t allocHeight = 0;

    if (resBind_.pakObj.res == nullptr)
    {
        allocSize = picWInMB_ * picHInMB_ * (16 * sizeof(uint32_t));  // MFC_AVC_PAK_OBJECT command is zero-padded to 16 DWORDs
        resBind_.pakObj.res = new MediaResource(RES_TYPE_BUFFER, RES_FORMAT_Buffer, allocSize, false, "PakObject");
        if (resBind_.pakObj.res->create() != 0)
            return -1;
    }
    sshResBindList_.push_back(resBind_.pakObj);

    if (resBind_.mvData.res == nullptr)
    {
        allocSize = picWInMB_ * picHInMB_ * 32 * 4;
        resBind_.mvData.res = new MediaResource(RES_TYPE_BUFFER, RES_FORMAT_Buffer, allocSize, false, "MvData");
        if (resBind_.mvData.res->create() != 0)
            return -1;
    }
    sshResBindList_.push_back(resBind_.mvData);

    // Current Picture Y
    if (resBind_.srcYuv.res != nullptr)
        sshResBindList_.push_back(resBind_.srcYuv);
    else
        return -1;

    // RefPicSelect of Current Picture
    if (resBind_.curRefPicSelect.res == nullptr)
    {
        allocWidth = UTIL_ALIGN((picWInMB_ * 8), 64);
        allocHeight = UTIL_ALIGN(2 * (picHInMB_ / 2), 8);
        resBind_.curRefPicSelect.res = new MediaResource(RES_TYPE_2D, RES_FORMAT_Buffer_2D, TILE_TYPE_LINEAR, allocWidth, allocHeight, "CurRefPicSelect");
        if (resBind_.curRefPicSelect.res->create() != 0)
            return -1;
    }
    sshResBindList_.push_back(resBind_.curRefPicSelect);

    // Note: this surface is not used for I frame. for P/B frame, this surface should be allocated by HME kernel
    // APGTODO: when HME packet is ready, we should pass this surface to MBEnc packet from external
    if (resBind_.mvPredictorFromHME.res == nullptr)
    {
        allocWidth = UTIL_ALIGN((picDs4xWInMB_ * 32), 64);
        allocHeight = (picDs4xHInMB_ * 2 * 4 * meDataSizeMultiplier_);
        resBind_.mvPredictorFromHME.res = new MediaResource(RES_TYPE_2D, RES_FORMAT_Buffer_2D, TILE_TYPE_LINEAR, allocWidth, allocHeight, "ME4xMvData");
        if (resBind_.mvPredictorFromHME.res->create() != 0)
            return -1;
    }
    sshResBindList_.push_back(resBind_.mvPredictorFromHME);

    // Note: this surface is not used for I frame (without BRC).
    // APGTODO: when HME packet is ready, we should pass this surface to MBEnc packet from external
    if (resBind_.distFromHME.res == nullptr)
    {
        allocWidth = UTIL_ALIGN((picDs4xWInMB_ * 8), 64);
        allocHeight = 2 * UTIL_ALIGN(((picDs4xHInMB_) * 4 * 10), 8);
        resBind_.distFromHME.res = new MediaResource(RES_TYPE_2D, RES_FORMAT_Buffer_2D, TILE_TYPE_LINEAR, allocWidth, allocHeight, "ME4xDistData");
        if (resBind_.distFromHME.res->create() != 0)
            return -1;
    }
    sshResBindList_.push_back(resBind_.distFromHME);

    if (resBind_.mbBrcConst.res == nullptr)
    {
        allocSize = 16 * 52 * sizeof(uint32_t); // 16 DWs per QP value
        resBind_.mbBrcConst.res = new MediaResource(RES_TYPE_BUFFER, RES_FORMAT_Buffer, allocSize, false, "MbBrcConst");
        if (resBind_.mbBrcConst.res->create() != 0)
            return -1;
    }
    sshResBindList_.push_back(resBind_.mbBrcConst);

    // current frame for VME (L0 & L1)
    resBind_.vmeInterPredCurPic.res = resBind_.srcYuv.res;
    sshResBindList_.push_back(resBind_.vmeInterPredCurPic);
    resBind_.vmeInterPredFwdMR.res = resBind_.srcYuv.res;
    sshResBindList_.push_back(resBind_.vmeInterPredFwdMR);

    // MbEnc BRC buffer - buffer written by BRC and used by MbEnc
    // Note: this surface should be passed from BRC kernel packet
    if (resBind_.brcBufForMbEnc.res == nullptr)
    {
        allocSize = 128;
        resBind_.brcBufForMbEnc.res = new MediaResource(RES_TYPE_BUFFER, RES_FORMAT_Buffer, allocSize, false, "BrcBufForMBEnc");
        if (resBind_.brcBufForMbEnc.res->create() != 0)
            return -1;
    }
    sshResBindList_.push_back(resBind_.brcBufForMbEnc);

    return 0;
}

int32_t AvcMBEncPacket::destroyResource()
{
    bool bFail = false;

    // Note: this res list may include some external resource we cannot destroy here
    // APGTODO: enumerate each internal resource and destroy them one by one
    for (auto resBind : sshResBindList_)
    {
        if (resBind.res != nullptr)
        {
            bFail |= (resBind.res->destroy() == 0) ? false : true;
        }
    }

    sshResBindList_.clear();

    return (bFail) ? -1 : 0;
}

